import React from 'react';

const HeaderImage = () => {
  return (
    <div className="header">
      <img
        src="https://cdn.vox-cdn.com/thumbor/vIBxFu597_J1Jxt0S2qLEg4aGVE=/0x150:3840x2160/fit-in/1200x630/cdn.vox-cdn.com/uploads/chorus_asset/file/23587546/20220525083706_png_.png"
        alt="Header Image, from Genshin Impact game footage"
        style={{ height: '100vh', width: '24%', align: 'left' }}
        className="cover"
      />
    </div>
  );
};

export default HeaderImage;
